import React from 'react'
import classes from "./Input.module.css"

function Input(props) {
  console.log(props.input);
  return (
   <div className={classes}>
  <label htmlFor={props.input.id}>{props.label}</label>
  <input  {...props.input} />
   </div>
  )
}

export default Input
